    public static int minChanges(String str)
    {
        int n = str.length();
        String[] a = str.split("");
        List<String> list = new ArrayList<String>();
        int k=n-1,l=0;
        for(int i=0; i<n;i++)
        {
            if(list.contains(a[i])){
            if(i<k){
                k=i;
            }
            if(i>l && !a[l].equals(a[i])){
                l=i;
            }
        }
			else
                list.add(a[i]);
        }
        if(l>k)
            return n-list.size();
        else if(k==l && k!=0 && l!=0){
            return 1;
        }
        else
            return 0;

    }

